import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './components/homescreen';
import Register from './components/Register';
import Login from './components/Login';
import Dashboard from './components/DashBoard';  // Assume this is a component to show after login

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/home" element={<HomePage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard />} />  {/* New route for after login */}
        <Route path="/" element={<HomePage />} />  {/* Redirect to HomePage */}
      </Routes>
    </Router>
  );
};

export default App;
